import React from 'react'
import './Main.css';

export default function Main() {
  return (
    <div className='main_content'>
        <header>     
        <img src="sport_images/page_15.png" alt="alt" />
        <ul>
            <li><a>Home</a></li>
            <li><a>Company</a></li>
            <li><a>Contact</a></li>
        </ul>
        </header>
    </div>
  )
}
